import MotionHoc from "./MotionHoc";
import styled from "styled-components";

const Section = styled.div`
    width: 100%;
    text-align: center;
    color: white;
`;

const ImageContainer = styled.div`
    width: 100%;
    text-align: center;
    color: white;
  \
`;

const ImageBox = styled.div`
    width: 20%;
    height: 200px;
    margin: 10px;
    display: inline-block;

    img {
      width: 100%;
      height: 100%;
      border-radius: 5px;
      box-shadow: rgb(244, 46, 53, 0.4) -5px 5px, rgb(244, 46, 53, 0.3) -10px 10px, rgb(244, 46, 53, 0.2) -15px 15px, rgb(244, 46, 53, 0.1) -20px 20px, rgb(244, 46, 53, 0.05) -25px 25px;
    }
`;

const ProjectsComponent = () => {
  return <Section>
            <h1>Albums</h1>
            <ImageContainer>
                <ImageBox>
                  <img src='https://images.unsplash.com/photo-1601066525716-3cca33c6d4c6?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1100&q=80' alt='dsdfsd' /> 
                </ImageBox>
                <ImageBox>
                  <img src='https://images.unsplash.com/photo-1601066525716-3cca33c6d4c6?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1100&q=80' alt='dsdfsd' /> 
                </ImageBox>
                <ImageBox>
                  <img src='https://images.unsplash.com/photo-1601066525716-3cca33c6d4c6?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1100&q=80' alt='dsdfsd' /> 
                </ImageBox>
                <ImageBox>
                  <img src='https://images.unsplash.com/photo-1601066525716-3cca33c6d4c6?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1100&q=80' alt='dsdfsd' /> 
                </ImageBox>

            </ImageContainer>

        </Section>;
};

const Projects = MotionHoc(ProjectsComponent);

export default Projects;
